	if err != nil {
		return fmt.Errorf("Error constructing id: %s", err)
	}
	d.SetId(id)

	log.Printf("[DEBUG] Finished creating ToolVersion %q: %#v", d.Id(), res)

	return resourceDialogflowCXToolVersionRead(d, meta)
